class Solution(object):
    def firstMissingPositive(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        # O(n) time and O(1) space

        n = len(nums)
        for i in range(n):
            while 1 <= nums[i] <= n and nums[i] != nums[nums[i]-1]:
                nums[nums[i]-1], nums[i] = nums[i], nums[nums[i]-1]

        for i in range(n):
            if i+1 != nums[i]:
                return i+1
        return n+1

permutation-sequence.solution:
class Solution(object):
    def getPermutation(self, n, k):
        """
        :type n: int
        :type k: int
        :rtype: str
        """

        def factorial(n):
            if n == 0:
                return 1
            else:
                return n * factorial(n-1)

        def get_permutation(n, k):
            if n == 1:
                return '1'
            else:
                f = factorial(n-1)
                index = (k-1) // f
                digit = str(index+1)
                rest = k - index * f
                return digit + get_permutation(n-1, rest)

        return get_permutation(n, k)

