class Solution(object):
    def fib(self, n):
        """
        :type n: int
        :rtype: int
        """

        if n == 0:
            return 0
        elif n == 1:
            return 1
        else:
            return self.fib(n-1) + self.fib(n-2)

find-k-th-smallest-pair-distance.solution:
class Solution(object):
    def smallestDistancePair(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """

        nums.sort()
        n = len(nums)
        dp = [[0] * (k+1) for _ in range(n)]
        for i in range(n):
            dp[i][0] = nums[i]
        for j in range(1, n):
            dp[j][0] = nums[j] - nums[j-1]
        for i in range(1, n):
            for j in range(1, min(k, i*(n-i))):
                dp[i][j] = min(dp[i-1][j-1], dp[i][j-1])
                if i < n-1:
                    dp[i][j] = min(dp[i][j], nums[i+1] - nums[i-j+1])
        return dp[n-1][k-1]

