reverse-vowels-of-a-string.solution:
class Solution(object):
    def reverseVowels(self, s):
        """
        :type s: str
        :rtype: str
        """

        vowels = ['a', 'e', 'i', 'o', 'u']
        vowels_upper = ['A', 'E', 'I', 'O', 'U']
        vowels.extend(vowels_upper)
        s = list(s)
        left = 0
        right = len(s) - 1
        while left < right:
            if s[left] in vowels and s[right] in vowels:
                s[left], s[right] = s[right], s[left]
                left += 1
                right -= 1
            elif s[left] not in vowels:
                left += 1
            elif s[right] not in vowels:
                right -= 1
        return ''.join(s)

find-first-and-last-position-of-element-.solution:
class Solution(object):
    def searchRange(self, nums, target):
        """
        :type nums: List[int]
        :type target: int
        :rtype: List[int]
        """

        # Find the index of first occurrence of target in nums
        first_occurence = self.find_first_occurence(nums, target)

        # If the first occurence is not found
        if first_occurence == -1:
            return [-1, -1]

        # Find the index of last occurrence of target in nums
        last_occurence = self.find_last_occurence(nums, target)

        return [first_occurence, last_occurence]

    def find_first_occurence(self, nums, target):
        """
        Find the index of first occurrence of target in nums
        """
        left = 0
        right = len(nums) - 1

        while left <= right:
            mid = (left + right) // 2

            if nums[mid] == target:
                # Check if mid is the first occurence of target
                if mid == 0 or nums[mid - 1] != target:
                    return mid
                else:
                    right = mid - 1
            elif nums[mid] < target:
                left = mid + 1
            else:
                right = mid - 1

        return -1

    def find_last_occurence(self, nums, target):
        """
        Find the index of last occurrence of target in nums
        """
        left = 0
        right = len(nums) - 1

        while left <= right:
            mid = (left + right) // 2

            if nums[mid] == target:
                # Check if mid is the last occurence of target
                if mid == len(nums) - 1 or nums[mid + 1] != target:
                    return mid
                else:
                    left = mid + 1
            elif nums[mid] < target:
                left = mid + 1
            else:
                right = mid - 1

        return -1

