class Solution(object):
    def removeDuplicates(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        if len(nums) == 0:
            return 0
        else:
            i = 0
            while i < len(nums) - 1:
                if nums[i] == nums[i + 1]:
                    nums.pop(i + 1)
                else:
                    i += 1
            return len(nums)

best-time-to-buy-and-sell-stock-iv.solution:
class Solution(object):
    def maxProfit(self, k, prices):
        """
        :type k: int
        :type prices: List[int]
        :rtype: int
        """

        if not prices:
            return 0

        n = len(prices)
        if k >= n//2:
            profit = 0
            for i in range(1, n):
                if prices[i] > prices[i-1]:
                    profit += prices[i] - prices[i-1]
            return profit

        dp = [[0] * (k+1) for _ in range(n)]

        for i in range(1, n):
            diff = prices[i] - prices[i-1]
            for j in range(1, k+1):
                dp[i][j] = max(dp[i-1][j-1] + max(diff, 0), dp[i-1][j] + diff)

        return dp[-1][-1]

convert-a-number-to-hexadecimal.solution:
class Solution(object):
    def toHex(self, num):
        """
        :type num: int
        :rtype: str
        """

        if num == 0:
            return "0"
        if num < 0:
            num = 2**32 + num
        hex_string = ""
        hex_digits = "0123456789abcdef"
        while num > 0:
            hex_string = hex_digits[num % 16] + hex_string
            num //= 16
        return hex_string

