class Solution(object):
    def findWords(self, words):
        """
        :type words: List[str]
        :rtype: List[str]
        """

        first_row = ['q','w','e','r','t','y','u','i','o','p']
        second_row = ['a','s','d','f','g','h','j','k','l']
        third_row = ['z','x','c','v','b','n','m']

        result = []

        for word in words:
            word = word.lower()
            flag = 0
            for letter in word:
                if letter in first_row:
                    flag = 1
                    break
                elif letter in second_row:
                    flag = 2
                    break
                elif letter in third_row:
                    flag = 3
                    break

            if flag == 1:
                if all(letter in first_row for letter in word):
                    result.append(word)
            elif flag == 2:
                if all(letter in second_row for letter in word):
                    result.append(word)
            elif flag == 3:
                if all(letter in third_row for letter in word):
                    result.append(word)

        return result

