# Definition for singly-linked list.
# class ListNode(object):
#     def __init__(self, val=0, next=None):
#         self.val = val
#         self.next = next
class Solution(object):
    def deleteDuplicates(self, head):
        """
        :type head: ListNode
        :rtype: ListNode
        """

        if head is None:
            return None

        if head.next is None:
            return head

        if head.val == head.next.val:
            head = head.next
            return self.deleteDuplicates(head)

        head.next = self.deleteDuplicates(head.next)
        return head

longest-palindrome.solution:
class Solution(object):
    def longestPalindrome(self, s):
        """
        :type s: str
        :rtype: int
        """

        # Initialize a dictionary to store the count of each character in the string
        char_count = {}
        for char in s:
            if char not in char_count:
                char_count[char] = 0
            char_count[char] += 1

        # Initialize a variable to store the length of the longest palindrome
        longest_palindrome = 0

        # Iterate through the characters in the string
        for char in char_count:
            # If the character appears an even number of times, we can include all of them in the palindrome
            if char_count[char] % 2 == 0:
                longest_palindrome += char_count[char]
            # If the character appears an odd number of times, we can include all of them except one in the palindrome
            else:
                longest_palindrome += char_count[char] - 1

        # Return the length of the longest palindrome
        return longest_palindrome

