class Solution(object):
    def removeInvalidParentheses(self, s):
        """
        :type s: str
        :rtype: List[str]
        """

        def isValid(s):
            count = 0
            for char in s:
                if char == '(':
                    count += 1
                elif char == ')':
                    count -= 1
                    if count < 0:
                        return False
            return count == 0

        # BFS
        # 1. find the first valid string
        # 2. find all the next valid strings
        # 3. add them to the queue
        # 4. repeat step 2 until the queue is empty

        # use a set to avoid duplicates
        # use a queue to implement BFS
        queue = collections.deque([s])
        visited = set()
        while queue:
            string = queue.popleft()
            if isValid(string):
                if string not in visited:
                    visited.add(string)
                    for i in range(len(string)):
                        if string[i] == '(' or string[i] == ')':
                            queue.append(string[:i] + string[i+1:])
        return list(visited)

