class Solution(object):
    def containVirus(self, isInfected):
        """
        :type isInfected: List[List[int]]
        :rtype: int
        """

        def dfs(i, j):
            if 0 <= i < m and 0 <= j < n and isInfected[i][j] == 1:
                isInfected[i][j] = 2
                dfs(i + 1, j)
                dfs(i - 1, j)
                dfs(i, j + 1)
                dfs(i, j - 1)

        m = len(isInfected)
        n = len(isInfected[0])
        walls = 0
        while True:
            infected = []
            for i in range(m):
                for j in range(n):
                    if isInfected[i][j] == 1:
                        infected.append((i, j))
            if not infected:
                break
            for i, j in infected:
                isInfected[i][j] = 2
            for i, j in infected:
                dfs(i, j)
            new_infected = set()
            for i, j in infected:
                for ni, nj in [(i + 1, j), (i - 1, j), (i, j + 1), (i, j - 1)]:
                    if 0 <= ni < m and 0 <= nj < n and isInfected[ni][nj] == 2:
                        new_infected.add((ni, nj))
            for i, j in infected:
                for ni, nj in [(i + 1, j), (i - 1, j), (i, j + 1), (i, j - 1)]:
                    if 0 <= ni < m and 0 <= nj < n and isInfected[ni][nj] == 0:
                        if (ni, nj) not in new_infected:
                            walls += 1
            for i, j in infected:
                isInfected[i][j] = 1
        return walls

