class Solution(object):
    def longestIncreasingPath(self, matrix):
        """
        :type matrix: List[List[int]]
        :rtype: int
        """

        if not matrix or not matrix[0]:
            return 0

        m = len(matrix)
        n = len(matrix[0])

        dp = [[0 for _ in range(n)] for _ in range(m)]

        for i in range(m):
            for j in range(n):
                dp[i][j] = self.dfs(matrix, i, j, dp)

        return max(max(row) for row in dp)

    def dfs(self, matrix, i, j, dp):
        if dp[i][j]:
            return dp[i][j]

        m = len(matrix)
        n = len(matrix[0])

        max_len = 1

        if i > 0 and matrix[i][j] > matrix[i-1][j]:
            max_len = max(max_len, self.dfs(matrix, i-1, j, dp) + 1)

        if i < m-1 and matrix[i][j] > matrix[i+1][j]:
            max_len = max(max_len, self.dfs(matrix, i+1, j, dp) + 1)

        if j > 0 and matrix[i][j] > matrix[i][j-1]:
            max_len = max(max_len, self.dfs(matrix, i, j-1, dp) + 1)

        if j < n-1 and matrix[i][j] > matrix[i][j+1]:
            max_len = max(max_len, self.dfs(matrix, i, j+1, dp) + 1)

        dp[i][j] = max_len
        return max_len

