        def get_time(hour, minute):
            return str(hour) + ':' + ('0' + str(minute) if minute < 10 else str(minute))

        def get_hours(num):
            return [i for i in range(12) if bin(i).count('1') == num]

        def get_minutes(num):
            return [i for i in range(60) if bin(i).count('1') == num]

