class Solution(object):
    def trapRainWater(self, heightMap):
        """
        :type heightMap: List[List[int]]
        :rtype: int
        """

        # Find the bounding rectangle
        r = len(heightMap)
        if r == 0:
            return 0
        c = len(heightMap[0])

        # Find the lowest point
        lowest = float('inf')
        for i in range(r):
            for j in range(c):
                lowest = min(lowest, heightMap[i][j])

        # Find the highest point
        highest = 0
        for i in range(r):
            for j in range(c):
                highest = max(highest, heightMap[i][j])

        # Find the highest point in the bounding rectangle
        for i in range(r):
            for j in range(c):
                if heightMap[i][j] == highest:
                    break
            else:
                continue
            break

        # Find the lowest point in the bounding rectangle
        for i in range(r-1, -1, -1):
            for j in range(c):
                if heightMap[i][j] == lowest:
                    break
            else:
                continue
            break

        # Find the leftmost and rightmost points in the bounding rectangle
        leftmost = float('inf')
        for i in range(r):
            if heightMap[i][j] == lowest:
                leftmost = min(leftmost, heightMap[i][j])

        rightmost = 0
        for i in range(r):
            if heightMap[i][j] == lowest:
                rightmost = max(rightmost, heightMap[i][j])

        # Find the highest point in the left and right columns
        left_highest = 0
        for i in range(r):
            if heightMap[i][j] == lowest:
                left_highest = max(left_highest, heightMap[i][j])

        right_highest = 0
        for i in range(r):
            if heightMap[i][j] == lowest:
                right_highest = max(right_highest, heightMap[i][j])

        # Find the highest point in the top and bottom rows
        top_highest = 0
        for j in range(c):
            if heightMap[i][j] == lowest:
                top_highest = max(top_highest, heightMap[i][j])

        bottom_highest = 0
        for j in range(c):
            if heightMap[i][j] == lowest:
                bottom_highest = max(bottom_highest, heightMap[i][j])

        # Find the highest point in the rectangle
        for i in range(r):
            for j in range(c):
                if heightMap[i][j] == lowest:
                    continue
                if heightMap[i][j] > highest:
                    continue
                if heightMap[i][j] > left_highest and heightMap[i][j] > right_highest:
                    continue
                if heightMap[i][j] > top_highest and heightMap[i][j] > bottom_highest:
                    continue
                highest = max(highest, heightMap[i][j])

        # Calculate the volume of water trapped
        volume = 0
        for i in range(r):
            for j in range(c):
                if heightMap[i][j] < highest:
                    volume += highest - heightMap[i][j]

        return volume

