class Solution(object):
    def divide(self, dividend, divisor):
        """
        :type dividend: int
        :type divisor: int
        :rtype: int
        """

        if dividend == 0:
            return 0
        if divisor == 1:
            return dividend
        if divisor == -1:
            return -dividend

        sign = 1
        if (dividend > 0 and divisor < 0) or (dividend < 0 and divisor > 0):
            sign = -1

        dividend = abs(dividend)
        divisor = abs(divisor)

        quotient = 0
        while dividend >= divisor:
            temp = divisor
            i = 0
            while dividend >= temp:
                dividend -= temp
                quotient += 2**i
                i += 1
                temp <<= 1

        if sign == -1:
            quotient = -quotient

        if quotient >= 2**31 - 1:
            return 2**31 - 1
        if quotient <= -2**31:
            return -2**31

        return quotient

