        :rtype: str
        """

        if num == 0:
            return "Zero"

        def helper(n):
            under_twenty = ["", "One", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine", "Ten", "Eleven", "Twelve", "Thirteen", "Fourteen", "Fifteen", "Sixteen", "Seventeen", "Eighteen", "Nineteen"]
            tens = ["", "Ten", "Twenty", "Thirty", "Forty", "Fifty", "Sixty", "Seventy", "Eighty", "Ninety"]
            if n < 20:
                return under_twenty[n]
            elif n < 100:
                return tens[n//10] + " " + helper(n%10)
            elif n < 1000:
                return helper(n//100) + " Hundred " + helper(n%100)
            elif n < 1000000:
                return helper(n//1000) + " Thousand " + helper(n%1000)
            elif n < 1000000000:
                return helper(n//1000000) + " Million " + helper(n%1000000)
            else:
                return helper(n//1000000000) + " Billion " + helper(n%1000000000)

        return helper(num).strip()

k-inverse-pairs-array.solution:
class Solution(object):
    def kInversePairs(self, n, k):
        """
        :type n: int
        :type k: int
        :rtype: int
        """

        MOD = 10**9 + 7
        dp = [[0] * (k+1) for _ in range(n+1)]
        for i in range(n+1):
            dp[i][0] = 1
        for i in range(1, n+1):
            for j in range(1, k+1):
                dp[i][j] = (dp[i-1][j] + dp[i-1][j-1]) % MOD
                if i >= 2:
                    dp[i][j] = (dp[i][j] - dp[i-2][j-1] + MOD) % MOD
        return dp[n][k]

