class Solution(object):
    def splitArray(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """

        def check(nums, k, mid):
            cnt = 0
            s = 0
            for i in range(len(nums)):
                s += nums[i]
                if s > mid:
                    cnt += 1
                    s = nums[i]
            cnt += 1
            return cnt <= k

        def check_mid(nums, k, left, right):
            while left < right:
                mid = (left + right) // 2
                if check(nums, k, mid):
                    right = mid
                else:
                    left = mid + 1
            return left

        left = max(nums)
        right = sum(nums)
        while left < right:
            mid = (left + right) // 2
            if check(nums, k, mid):
                right = mid
            else:
                left = mid + 1
        return left

