find-the-closest-palindrome.solution:
class Solution(object):
    def nearestPalindromic(self, n):
        """
        :type n: str
        :rtype: str
        """

        def isPalindrome(s):
            return s == s[::-1]

        def getPalindrome(s):
            return s + s[::-1]

        def getClosest(s):
            s = int(s)
            s1 = (s // 10) + (s % 10)
            s2 = int(s / 10)
            return str(s1) + str(s1)[::-1] if abs(s - s1) < abs(s - s2) else str(s2) + str(s2)[::-1]

        if len(n) == 1:
            return '0'
        elif len(n) == 2:
            return getPalindrome(n)
        else:
            mid = len(n) // 2
            left = n[:mid]
            right = n[mid:]
            if left == right:
                return getClosest(n)
            else:
                return getPalindrome(left + right)

