        """
        :type x: int
        :rtype: int
        """

        if x == 0:
            return 0

        if x > 0:
            sign = 1
        else:
            sign = -1

        x = abs(x)

        rev = 0
        while x > 0:
            rev = rev * 10 + x % 10
            x = x // 10

        rev = rev * sign

        if rev < -2**31 or rev > 2**31 - 1:
            return 0
        else:
            return rev

