        """
        :type stones: List[int]
        :rtype: bool
        """

        if len(stones) == 1:
            return True

        if stones[1] != 1:
            return False

        dp = [False] * len(stones)
        dp[1] = True

        for i in range(2, len(stones)):
            for j in range(i):
                if dp[j] and stones[i] - stones[j] <= j + 1:
                    dp[i] = True
                    break

        return dp[-1]

