        """
        :type score: List[int]
        :rtype: List[str]
        """

        # Sort the list in descending order
        score.sort(reverse=True)

        # Create a dictionary to map the scores to their ranks
        rank_dict = {score[i]: i+1 for i in range(len(score))}

        # Create a list to map the ranks to their corresponding medal
        rank_medal = {1: "Gold Medal", 2: "Silver Medal", 3: "Bronze Medal"}

        # Create an empty list to store the final answer
        answer = []

        # Iterate through the scores and map them to their corresponding rank and medal
        for i in score:
            if rank_dict[i] in rank_medal:
                answer.append(rank_medal[rank_dict[i]])
            else:
                answer.append(str(rank_dict[i]))

        return answer

