class Solution(object):
    def reachingPoints(self, sx, sy, tx, ty):
        """
        :type sx: int
        :type sy: int
        :type tx: int
        :type ty: int
        :rtype: bool
        """

        while sx < tx and sy < ty:
            if tx < ty:
                ty %= tx
            else:
                tx %= ty
        if sx == tx and sy == ty:
            return True
        elif sx == tx:
            return (ty - sy) % sx == 0
        elif sy == ty:
            return (tx - sx) % sy == 0
        else:
            return False

