class Solution(object):
    def strangePrinter(self, s):
        """
        :type s: str
        :rtype: int
        """

        # Dynamic Programming
        # Time: O(n^2)
        # Space: O(n^2)

        n = len(s)
        dp = [[0]*n for _ in range(n)]

        for i in range(n-1,-1,-1):
            dp[i][i] = 1
            for j in range(i+1,n):
                if s[i] == s[j]:
                    dp[i][j] = dp[i][j-1]
                else:
                    dp[i][j] = dp[i][j-1] + 1
                for k in range(i+1,j):
                    dp[i][j] = min(dp[i][j], dp[i][k-1] + dp[k][j-1])
        return dp[0][n-1]

