class Solution(object):
    def maxSlidingWindow(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: List[int]
        """

        if len(nums) == 0:
            return []

        if k == 1:
            return nums

        max_window = []
        window = []
        for i in range(len(nums)):
            if len(window) > 0 and window[0] == i - k:
                window.pop(0)
            while len(window) > 0 and nums[window[-1]] < nums[i]:
                window.pop()
            window.append(i)
            if i >= k - 1:
                max_window.append(nums[window[0]])
        return max_window

