class Solution(object):
    def isRectangleCover(self, rectangles):
        """
        :type rectangles: List[List[int]]
        :rtype: bool
        """

        # find the min and max x and y
        x_min = 1000000000
        x_max = -1000000000
        y_min = 1000000000
        y_max = -1000000000

        for rectangle in rectangles:
            x_min = min(x_min, rectangle[0])
            y_min = min(y_min, rectangle[1])
            x_max = max(x_max, rectangle[2])
            y_max = max(y_max, rectangle[3])

        area = (x_max - x_min) * (y_max - y_min)
        total_area = 0

        for rectangle in rectangles:
            total_area += (rectangle[2] - rectangle[0]) * (rectangle[3] - rectangle[1])

        if total_area != area:
            return False

        points = set()

        for rectangle in rectangles:
            for x in [rectangle[0], rectangle[2]]:
                for y in [rectangle[1], rectangle[3]]:
                    points.add((x, y))

        for x in [x_min, x_max]:
            for y in [y_min, y_max]:
                if (x, y) not in points:
                    return False

        return True

