class Solution(object):
    def strongPasswordChecker(self, password):
        """
        :type password: str
        :rtype: int
        """

        # 1. Check if password is strong
        # 2. If not strong, check for the missing conditions
        # 3. If missing conditions are 3, then return 6 - len(password)
        # 4. If missing conditions are 2, then return 5 - len(password)
        # 5. If missing conditions are 1, then return 4 - len(password)
        # 6. If missing conditions are 0, then return 3 - len(password)

        # 1. Check if password is strong
        if len(password) < 6 or len(password) > 20:
            return 0
        if not any(char.islower() for char in password):
            return 0
        if not any(char.isupper() for char in password):
            return 0
        if not any(char.isdigit() for char in password):
            return 0
        if '!' in password or '.' in password:
            return 0

        # 2. If not strong, check for the missing conditions
        missing_conditions = 0
        if not any(char.islower() for char in password):
            missing_conditions += 1
        if not any(char.isupper() for char in password):
            missing_conditions += 1
        if not any(char.isdigit() for char in password):
            missing_conditions += 1

        # 3. If missing conditions are 3, then return 6 - len(password)
        if missing_conditions == 3:
            return 6 - len(password)

        # 4. If missing conditions are 2, then return 5 - len(password)
        if missing_conditions == 2:
            return 5 - len(password)

        # 5. If missing conditions are 1, then return 4 - len(password)
        if missing_conditions == 1:
            return 4 - len(password)

        # 6. If missing conditions are 0, then return 3 - len(password)
        if missing_conditions == 0:
            return 3 - len(password)

