class Solution(object):
    def convert(self, s, numRows):
        """
        :type s: str
        :type numRows: int
        :rtype: str
        """

        if numRows == 1:
            return s

        rows = [''] * numRows
        direction = 1
        row = 0

        for char in s:
            rows[row] += char
            if row == numRows - 1 or row == 0:
                direction = -direction
            row += direction

        return ''.join(rows)

