class Solution(object):
    def countOfAtoms(self, formula):
        """
        :type formula: str
        :rtype: str
        """

        # stack to store the current element and its count
        stack = []

        # current element and its count
        cur_element = ""
        cur_count = 0

        # result map
        result = {}

        for i in range(len(formula)):
            if formula[i].islower():
                cur_element += formula[i]
            elif formula[i].isdigit():
                cur_count = int(formula[i])
            elif formula[i] == "(":
                stack.append([cur_element, cur_count])
                cur_element = ""
                cur_count = 0
            elif formula[i] == ")":
                count = stack.pop()[1]
                if cur_count > 0:
                    count *= cur_count
                cur_count = count
            else:
                if cur_element != "":
                    if cur_element not in result:
                        result[cur_element] = 0
                    result[cur_element] += cur_count
                cur_element = formula[i]
                cur_count = 1

        # handle last element
        if cur_element != "":
            if cur_element not in result:
                result[cur_element] = 0
            result[cur_element] += cur_count

        # build the answer
        answer = ""
        for element in sorted(result.keys()):
            answer += element
            if result[element] > 1:
                answer += str(result[element])
        return answer

