class Solution(object):
    def generateParenthesis(self, n):
        """
        :type n: int
        :rtype: List[str]
        """

        def generate(A = [], left = 0, right = 0, n = n):
            if len(A) == 2*n:
                yield "".join(A)
                return
            if left < n:
                A.append("(")
                for g in generate(A, left+1, right, n):
                    yield g
                A.pop()
            if right < left:
                A.append(")")
                for g in generate(A, left, right+1, n):
                    yield g
                A.pop()
        return [i for i in generate()]

