class Solution(object):
    def fractionToDecimal(self, numerator, denominator):
        """
        :type numerator: int
        :type denominator: int
        :rtype: str
        """

        if numerator == 0:
            return "0"

        if denominator == 0:
            return "NaN"

        if numerator < 0 and denominator > 0:
            sign = "-"
        elif numerator > 0 and denominator < 0:
            sign = "-"
        else:
            sign = ""

        numerator = abs(numerator)
        denominator = abs(denominator)

        whole = str(numerator // denominator)
        fraction = str(numerator % denominator)

        if fraction == "0":
            return sign + whole

        fraction_dict = {}
        fraction_list = []
        while fraction not in fraction_dict:
            fraction_dict[fraction] = len(fraction_list)
            fraction = str(int(fraction) * 10)
            fraction_list.append(fraction)

        fraction_string = "".join(fraction_list)
        fraction_string = fraction_string[:fraction_dict[fraction]] + "(" + fraction_string[fraction_dict[fraction]:] + ")"

        return sign + whole + "." + fraction_string

