class Solution(object):
    def findWords(self, board, words):
        """
        :type board: List[List[str]]
        :type words: List[str]
        :rtype: List[str]
        """

        # Initialize the Trie
        root = {}
        for word in words:
            current = root
            for letter in word:
                if letter not in current:
                    current[letter] = {}
                current = current[letter]
            current['#'] = '#'

        # Initialize the answer
        found_words = []

        # Iterate through the board
        for i in range(len(board)):
            for j in range(len(board[0])):
                # Check if the current cell is the starting of any word
                if board[i][j] in root:
                    current = root[board[i][j]]
                    self.dfs(i, j, board, current, found_words)

        return found_words

    def dfs(self, i, j, board, current, found_words):
        # If we have found the entire word, add it to the answer
        if '#' in current:
            found_words.append(board[i][j])

        # If the current cell is not a starting of any word, return
        if board[i][j] not in current:
            return

        # Temporarily mark the current cell as visited
        board[i][j] = ' '

        # Recursively explore all the adjacent cells
        if i > 0 and board[i - 1][j] != ' ':
            self.dfs(i - 1, j, board, current[board[i - 1][j]], found_words)
        if j > 0 and board[i][j - 1] != ' ':
            self.dfs(i, j - 1, board, current[board[i][j - 1]], found_words)
        if i < len(board) - 1 and board[i + 1][j] != ' ':
            self.dfs(i + 1, j, board, current[board[i + 1][j]], found_words)
        if j < len(board[0]) - 1 and board[i][j + 1] != ' ':
            self.dfs(i, j + 1, board, current[board[i][j + 1]], found_words)

        # Backtrack
        board[i][j] = current.keys()[0]

valid-anagram.solution:
class Solution(object):
    def isAnagram(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """

        # if length of s and t are not equal then they are not anagrams
        if len(s) != len(t):
            return False

        # if length of s and t are equal then we need to check if they are anagrams or not
        else:
            # we will use dictionary to store the frequency of each character in s
            s_dict = {}
            for i in s:
                if i not in s_dict:
                    s_dict[i] = 1
                else:
                    s_dict[i] += 1

            # we will use dictionary to store the frequency of each character in t
            t_dict = {}
            for i in t:
                if i not in t_dict:
                    t_dict[i] = 1
                else:
                    t_dict[i] += 1

            # if s_dict and t_dict are equal then they are anagrams
            if s_dict == t_dict:
                return True
            else:
                return False

valid-sudoku.solution:
class Solution(object):
    def isValidSudoku(self, board):
        """
        :type board: List[List[str]]
        :rtype: bool
        """

        #check rows
        for row in board:
            if not self.isValidList(row):
                return False

        #check columns
        for col in zip(*board):
            if not self.isValidList(col):
                return False

        #check 3x3 sub-boxes
        for i in (0,3,6):
            for j in (0,3,6):
                box = [board[x][y] for x in range(i,i+3) for y in range(j,j+3)]
                if not self.isValidList(box):
                    return False

        return True

    def isValidList(self,myList):
        mySet = set()
        for i in myList:
            if i != '.':
                if i in mySet:
                    return False
                else:
                    mySet.add(i)
        return True

