class Solution(object):
    def findAllConcatenatedWordsInADict(self, words):
        """
        :type words: List[str]
        :rtype: List[str]
        """

        # Sort the list of words in descending order of length
        words.sort(key=len, reverse=True)

        # Initialize a list to store the results
        res = []

        # Iterate over the list of words
        for w in words:

            # Check if the current word is a concatenated word
            if self.isConcatenated(w, words):
                res.append(w)

        return res

    def isConcatenated(self, word, words):

        # Base case
        if not word:
            return False

        # Iterate over the list of words
        for w in words:

            # Check if the current word is a prefix of the given word
            if word.startswith(w):

                # Recursive call
                if self.isConcatenated(word[len(w):], words):
                    return True

        return False

