class Solution(object):
    def totalNQueens(self, n):
        """
        :type n: int
        :rtype: int
        """

        def is_safe(board, row, col):
            for i in range(row):
                if board[i][col] == 1:
                    return False
            for i, j in zip(range(row, -1, -1), range(col, -1, -1)):
                if board[i][j] == 1:
                    return False
            for i, j in zip(range(row, -1, -1), range(col, n)):
                if board[i][j] == 1:
                    return False
            return True

        def dfs(board, row):
            if row == n:
                return 1
            count = 0
            for col in range(n):
                if is_safe(board, row, col):
                    board[row][col] = 1
                    count += dfs(board, row + 1)
                    board[row][col] = 0
            return count

        board = [[0] * n for _ in range(n)]
        return dfs(board, 0)

