        :rtype: List[List[str]]
        """

        def is_safe(board, row, col):
            for i in range(row):
                if board[i][col] == 'Q':
                    return False
            for i, j in zip(range(row, -1, -1), range(col, -1, -1)):
                if board[i][j] == 'Q':
                    return False
            for i, j in zip(range(row, -1, -1), range(col, n)):
                if board[i][j] == 'Q':
                    return False
            return True

        def dfs(board, row):
            if row == n:
                result.append(board)
                return
            for col in range(n):
                if is_safe(board, row, col):
                    board[row][col] = 'Q'
                    dfs(board, row + 1)
                    board[row][col] = '.'

        result = []
        board = [['.'] * n for _ in range(n)]
        dfs(board, 0)
        return result

